use strict;
use warnings;


### Globals
use constant VERBOSE => 1;
use constant DEBUG => 0;

my $VERSION = "0.1 beta";

use vars qw/ %opt /;

# Parse cmdl args
&init();

my $chr_col = $opt{c}?$opt{c}:0;
my $pos_col = $opt{p}?$opt{p}:1;
my $base_col = $opt{b}?$opt{b}:2;
my $OMIT_INSERTIONS = $opt{o}?1:0;

warn "[I]  This is translate_tair8.pl version $VERSION\n";
warn "[I]  try $0 -h if you need help\n" if(VERBOSE);
warn "[I]  Column mapping: chromosome => $chr_col, position => $pos_col, base => $base_col\n" if(VERBOSE);
warn "[I]  OMIT_INSERTIONS is activated!\n" if($OMIT_INSERTIONS && VERBOSE);
warn "[I]  Reading from STDIN ... \n" if(VERBOSE);

&update($chr_col, $pos_col, $base_col);


###
### Starting subs
###


#
# Command line options processing
#
sub init()
{
	use Getopt::Std;
	my $opt_string = 'c:p:b:oh';
	getopts( "$opt_string", \%opt ) or usage();
	usage() if $opt{h};
}


sub usage()
{
	print STDERR << "EOF";

This tool translates TAIR8 to TAIR9 coordinates and bases including
deletions, substitutions and insertions.
Tab seperated records are read from STDIN.

Written 2012 by Joffrey Fitz <joffrey.fitz\@tuebingen.mpg.de>

usage: zcat <TAIR8 file> | $0 [-c <chromosome column>] [-p <position column>] [-b <base column>] [-o]

	-c     : column which holds chromosomes, default 0
	-p     : column which holds positions, default 1
	-b     : column which holds bases, default 2
	-o     : omit insertions, only deletions and substitutions are processed.
	         This is handy if you try to convert variant calls.

EOF

	exit;
}


sub update {
	my @in_l = get_left();
	my @tr_l = get_right();

	my $pos_shift_cnt = 0;
	my $last_run = 0;
	my $chr_change = 0;
	
	if($tr_l[3] eq "insertion") {
		warn "first line: $tr_l[3] pos_shift_cnt = $pos_shift_cnt";
	}

	while(1) {

		my ($chr, $pos, $base) = @in_l[$chr_col, $pos_col, $base_col];
		my ($tr_chr, $tr_pos) = ($tr_l[0], $tr_l[1]);		
		warn "Checking $chr, $pos :: $tr_chr, $tr_pos" if(DEBUG);
		
		my $pos_t9 = $pos;
		
		if(eof STDIN) {
			warn "warn: eof STDIN" if(DEBUG);
			
			$last_run=1;
		}
		if( $chr > 5 ) {
			print join("\t", @in_l) . "\n";
			last if($last_run);
			@in_l = get_left();
			next;
		}
		if(eof main::DATA) {
			warn "warn: eof main::DATA" if(DEBUG);
			
			@in_l[$chr_col, $pos_col, $base_col] = ($chr, $pos+$pos_shift_cnt, $base);
			print join("\t", @in_l) . "\n";
			
			last if($last_run);
			
			@in_l = get_left();
			next;
		}

		if( $chr == $tr_chr) {
			if($chr_change) {
				warn "chromosome changed!" if(DEBUG);
				$pos_shift_cnt = 0;
				$chr_change = 0;
			}
			if($pos == $tr_pos) {
				warn "  == T9 change at $chr:$pos\n";
				
				if($tr_l[3] eq "insertion") {
					if($OMIT_INSERTIONS) {
						warn "      [_] Skipping insertion at $chr:$pos_t9, pos_shift_cnt=$pos_shift_cnt\n" if(VERBOSE);
						@tr_l = get_right();
						
						next;
					}
					
					# Print inserted bases
					my @ins_bases = split(//, $tr_l[4]);
					foreach my $b (@ins_bases) {
						@in_l[$chr_col, $pos_col, $base_col] = ($chr, $pos_t9+$pos_shift_cnt, $b);
						print join("\t", @in_l) . "\n";
						$pos_shift_cnt++;
					}
					warn "      [+] Updated insertion at $chr:$pos_t9, pos_shift_cnt=$pos_shift_cnt\n" if(VERBOSE);

					# Print base
					@in_l[$chr_col, $pos_col, $base_col] = ($chr, $pos_t9+$pos_shift_cnt, $base);
					print join("\t", @in_l) . "\n";

					@in_l = get_left();
					@tr_l = get_right();
				
				} elsif($tr_l[3] eq "deletion") {
					my $del_bases = length($tr_l[4]);
					
					# long deletion (>1bp) ?
					if( $del_bases>1 ) {
						for(my $i=0; $i<$del_bases; $i++) {
							@in_l = get_left(); # scan over the deleted positions, we do not need them
						}
						warn "      [-] Updated $del_bases bp deletion at  $chr:$pos_t9, pos_shift_cnt=$pos_shift_cnt\n" if(VERBOSE);
					}
					
					
					# 1bp deletion
					else {
						$pos_shift_cnt--;
						warn "      [-] Updated 1 bp deletion at  $chr:$pos_t9, pos_shift_cnt=$pos_shift_cnt\n" if(VERBOSE);
						
						@in_l = get_left();
						@tr_l = get_right();
					}
					
				} elsif($tr_l[3] eq "substitution") {
					@in_l[$chr_col, $pos_col, $base_col] = ($chr, $pos_t9+$pos_shift_cnt, $tr_l[5]);
					print join("\t", @in_l) . "\n";
					warn "      [/] Updated substitution $base_col / $base / $tr_l[5] at $chr:$pos_t9, pos_shift_cnt=$pos_shift_cnt\n" if(VERBOSE);
				
					@in_l = get_left();
					@tr_l = get_right();
				}
				else { # no variation, print T8 base
					die "Unsuported variation type: $tr_l[3]";
				}
				
			}
			else {

				if($pos < $tr_pos) {
					# no variation, print T8 base but T9 position
					@in_l[$chr_col, $pos_col, $base_col] = ($chr, $pos_t9+$pos_shift_cnt, $base);
					print join("\t", @in_l) . "\n";
					@in_l = get_left();
				}
				elsif($pos > $tr_pos) {
					warn "pos=$pos > tr_pos=$tr_pos, get_right()" if(DEBUG);
					
					my $indel_len = length($tr_l[4]);
					if($tr_l[3] eq "insertion") {	
						$pos_shift_cnt += $indel_len;
						warn "*** Found: $tr_l[3] at $tr_chr:$tr_pos, len=$indel_len, pos_shift_cnt=$pos_shift_cnt" if(DEBUG);
					}
					elsif($tr_l[3] eq "deletion") {
						$pos_shift_cnt -= $indel_len;
						warn "*** Found: $tr_l[3] at $tr_chr:$tr_pos, len=$indel_len, pos_shift_cnt=$pos_shift_cnt" if(DEBUG);
					}
					@tr_l = get_right();
				}
			}
		} elsif($chr < $tr_chr) {
			warn "  chr=$chr < tr_chr=$tr_chr" if(DEBUG);;
			$chr_change = 1 if(not $chr_change);
			# Print remaining bases from previous chromosome
			if($in_l[$chr_col] != $tr_chr) {
				# Print T8 base but T9 position
				@in_l[$chr_col, $pos_col, $base_col] = ($chr, $pos+$pos_shift_cnt, $base);
				
				print join("\t", @in_l) . "\n";	
			}
			last if($last_run);
			
			@in_l = get_left();
			
			($chr, $pos, $base) = @in_l[$chr_col, $pos_col, $base_col];
			
		} elsif(eof main::DATA) {
			# Print remaining bases
			
		} 
		else {
			$chr_change = 1 if(not $chr_change);
			@tr_l = get_right();
		}
		
		last if($last_run);
	}
}

sub get_left {
	my @in_l = @_;
	
	if(not eof STDIN) {
		my $stdin_buf = <STDIN>;
		chomp $stdin_buf;
		@in_l = split("\t", $stdin_buf);
	}

	return @in_l;
}

sub get_right {
    my @tr_l = @_;
 	die "Died! eof main::DATA" if(eof main::DATA);
 
    if(not eof main::DATA) {
	    my $trans_buf = <main::DATA>;
		chomp $trans_buf;
        @tr_l = split("\t", $trans_buf);
    }   

    return @tr_l;
}






